// vinoService.js
import axios from 'axios';

const API_URL = 'http://localhost:3000/vinos'; // Reemplaza con la URL de tu backend si es diferente

// Servicio para obtener todos los vinos
export const getAllVinos = async () => {
  try {
    const response = await axios.get(API_URL);
    return response.data;
  } catch (error) {
    console.error('Error al obtener los vinos', error);
    throw error;
  }
};
